        "在象棋术语中，开局先手方第一步即进炮打掉对方的马，被称为“杀惊”。此时，规则允许后手可先走一步马（即“遁马”象棋术语），接着再走一着其它棋，等于一次走两着，也可暂不动马，直接走一着其它棋，但这样后手就只能走一着棋。对应“杀惊”（象棋术语）走两着必先动马，是针对“遁马”方明确走一着或是走两着的手法规则，此规则对双方棋手判断很重要，并适合电脑程序方面的判断设计如果开局炮换马，那绝对是大亏，若是用两个炮打掉对方两个马，双方如果象棋水平都比较弱，那么这盘棋胜负还不一定，还能继续对弈。如果双方都是省市或者大师级高手，那么这盘棋胜负已分，先手方必败无疑，毫无悬念。从基本的棋理来说，你打掉对手双马，对手用双车吃了。双炮换双马兑了两个子，双方各走了两步棋，但是后手方借此机会出了两步车，是有效行棋，比先手方多走两步。而先手方却相当于一步没走，已经落入下风。 从行棋效率上就已经净亏两先。凡是有一定象棋水平的棋友都知道，对于持有两先的一方来说，绝对是不小的优势。 国家象棋大师、特级大师对上市级高手，也仅仅让两先而已。比如近些年山西举办的宝宝杯象棋大师邀请赛，就有过大师特大让市级高手两先的对局。 从子力价值上来说，开中局阶段，炮的价值比马大。马属于中距离作战棋子，炮属于远距离作战棋子。马在开局阶段，从己方阵地开赴敌方阵地需要好多步数，而开局阶段子力拥挤，易受到兵卒等阻碍，发挥不出马踏八方的威力。相比于马，炮就灵活多了。行动迅速，来去自如，在开中局阶段就能发挥出强大的威力，再配以双车早出的优势，双车双炮四字联合作战，对方如何能抵挡？车的战斗力最强，但也埋得最深，把车调出来的功夫可以让对方积累几步优势，所以不会开局无脑出车但你用炮干掉对方马，对方车吃掉你炮的同时还出来了，你就失了势而且场上子多的情况下炮比较好用，子少的时候马比较好用，开局子多的时候你就自废双炮，又是劣势。所以小编认为没必要用炮去打对方的马",
        "早对 LevelDB 有所耳闻，这次心血来潮结合一些资料粗略过了遍代码，果然名不虚传。如果你对存储感兴趣、如果你优雅使用 C++、如果你想学习如何架构项目，都推荐来观摩一下。更何况作者是 Sanjay Ghemawat 和 Jeff Dean 呢。 看过一遍如果不输出点什么，以我的记性，定会很快抛诸脑后。便想写点东西说说 LevelDB 之妙，但又不想走寻常路：从架构概览说起，以模块分析做合。读代码的这些天，一直在盘算从哪下笔比较好。在将将读完之时，印象最深的反而是 LevelDB 的各种精妙的数据结构：贴合场景、从头构建、剪裁得当、代码精到。不妨， LevelDB 系列就从这些边边角角的小构件开始吧。 本系列主要想分享 LevelDB 中用到的三个工程中常用的经典数据结构，分别是用以快速读写 memtable 的 Skip List、用以快速筛选 sstable 的 Bloom Filter 和用以部分缓存 sstable 的 LRUCache 。这是第三篇，LRUCache。引子LRU 是工程中多见的一个数据结构，常用于缓存场景。近年来，LRU 也是面试中一道炙手可热的考题，一来工程用的多，二来代码量较少，三来涉及的数据结构也很典型。LeetCode 中有一道相应的题目：lru-cache。相对实际场景，题目进行了简化：本质上要求维护一个按访问时间有序的 kv 集合，且 kv 皆是整数。经典解法是使用一个哈希表（unordered_map）和一个双向链表，哈希表解决索引问题，双向链表维护访问顺序。这是我当时的一个解法，特点是用了两个辅助函数，并且可以返回节点自身，以支持链式调用，从而简化了代码。说回 LevelDB 源码，作为一个工业品，它使用 的 LRUCache 又做了哪些优化和变动呢？下面让我们一块来拆解下 LevelDB 中使用的 LRUCache，看看有什么不同。本文首先明确 LRUCache 的使用方法，然后总览分析 LRUCache 的实现思路，最后详述相关数据结构的实现细节。缓存使用在分析 LRUCache 的实现之前，首先了解下 LRUCache 的使用方法，以明确 LRUCache 要解决的问题。以此为基础，我们才能了解为什么要这么实现，甚至更进一步，探讨有没有更好的实现。首先来看下 LevelDB 的导出接口 Cache：// 插入一个键值对（key，value）到缓存（cache）中，// 并从缓存总容量中减去该键值对所占额度（charge）//// 返回指向该键值对的句柄（handle），调用者在用完句柄后，// 需要调用 this->Release(handle) 进行释放// 在键值对不再被使用时，键值对会被传入的 deleter 参数// 释放virtual Handle* Insert(const Slice& key, void* value, size_t charge,// lru 双向链表的空表头// lru.prev 指向最新的条目，lru.next 指向最老的条目// 此链表中所有条目都满足 refs==1 和 in_cache==true// 表示所有条目只被缓存引用，而没有客户端在使用LRUHandle lru_ GUARDED_BY(mutex_);// in-use 双向链表的空表头         // 保存所有仍然被客户端引用的条目        // 由于在被客户端引用的同时还被缓存引用，// 肯定有 refs >= 2 和 in_cache==true.LRUHandle in_use_ GUARDED_BY(mutex_);// 所有条目的哈希表索引HandleTable table_ GUARDED_BY(mutex_);};可以看出该实现有以下特点：使用两个双向链表将整个缓存分成两个不相交的集合：被客户端引用的 in-use 链表，和不被任何客户端引用的 lru_ 链表。每个双向链表使用了一个空的头指针，以便于处理边界情况。并且表头的 prev 指针指向最新的条目，next 指针指向最老的条目，从而形成了一个双向环形链表。使用 usage_ 表示缓存当前已用量，用 capacity_ 表示该缓存总量。抽象出了几个基本操作：LRU_Remove、LRU_Append、Ref、Unref 作为辅助函数进行复用。每个 LRUCache 由一把锁 mutex_ 守护。了解了所有字段，以及之前的状态机，每个函数的实现应该比较容易理解。下面不再一一罗列所有函数的实现，仅挑比较复杂的 Insert 进行注释说明：Cache::Handle* LRUCache::Insert(const Slice& key, uint32_t hash, void* value,size_t charge,void (*deleter)(const Slice& key,                      void* value)) {    MutexLock l(&mutex_);// 构建数据条目句柄LRUHandle* e =reinterpret_cast<LRUHandle*>(malloc(sizeof(LRUHandle) - 1 + key.size()));e->value = value;e->deleter = deleter;e->charge = charge;e->key_length = key.size();e->hash = hash;e->in_cache = false;e->refs = 1;  // 客户端引用std::memcpy(e->key_data, key.data(), key.size());if (capacity_ > 0) {e->refs++;  // 缓存本身引用e->in_cache = true;LRU_Append(&in_use_, e);usage_ += charge;FinishErase(table_.Insert(e)); // 如果是替换，要删除原来数据} else {  // capacity_==0 时表示关闭缓存，不进行任何缓存// next 会在 key() 函数中被 assert 测试，因此要初始化一下e->next = nullptr;}// 当超数据条目超出容量时，根据 LRU 策略将不被客户端引用的数据条目驱逐出内存while (usage_ > capacity_ && lru_.next != &lru_) {LRUHandle* old = lru_.next;assert(old->refs == 1);bool erased = FinishErase(table_.Remove(old->key(), old->hash));if (!erased) {  // to avoid unused variable when compiled NDEBUGassert(erased);}}return reinterpret_cast<Cache::Handle*>(e);}ShardedLRUCache——分片 LRUCache引入 SharedLRUCache 的目的在于减小加锁的粒度，提高读写并行度。策略比较简洁—— 利用 key 哈希值的前 kNumShardBits = 4 个 bit 作为分片路由，可以支持 kNumShards = 1 << kNumShardBits  16 个分片。通过 key 的哈希值计算分片索引的函数如下：static uint32_t Shard(uint32_t hash) { return hash >> (32 - kNumShardBits); }由于 LRUCache 和 ShardedLRUCache 都实现了 Cache 接口，因此 ShardedLRUCache 只需将所有 Cache 接口操作路由到对应 Shard 即可，总体来说 ShardedLRUCache 没有太多逻辑，更像一个 Wrapper，这里不再赘述",
        "经济上确实不算第三城了，不过国际综合排名确实是大陆第三，港澳台不算未计入情况。如果计入港澳台的话，香港是第二，广州是第四，台北第五，深圳第六。不过香港这个有国际亲近外国的加分，广州则是被评为最不欢迎外国人的城市的，所以这个是有拉低综合分数的。如果直接看国际排名，23年国际排名广州55，深圳要排到73，也就是中间还隔着18座城市。这是城市综合排名，并非经济排名。经济上肯定是被深圳远远超过了，而且看不到翻盘机会，除非把深圳一样拉入三级财政，要不然永远不可能回到第三了。广州也不至于像网上说的那么差，至少几大基础资源来说，广州给普通市民提供的资源比深圳给的多，深圳给有钱人的资源比给普通人的多。从普通人的角度来看，在广州生活是比深圳幸福感更强的。深圳如果现在没有买到合适的房子（老破小不计入，因为未来老破小价值会断层式下跌），没有稳定的超出深圳中位数收入的平均收入的话。那么未来对于普通人来说会更卷，生存将是地狱难度的，因为一个是人住的舒服又方便的房子只会越来越贵，现在买不起深圳好房子的话，未来只会更买不起，住一辈子老破小幸福感就别说高了，远郊也一样，上个班一个多小时，来回通勤就三小时了，还要加班，在家里的时间有多少？还有多少娱乐时间和陪伴家庭的时间？还不如回老家住独栋别墅。另外就是除了住房成本，生活成本也太高了，基本深圳的生活成本就是广东省内最高的城市了。但在这么一个城市，资源并不是以居民优先的，可能二级财政的城市都这样，人就只是耗材罢了，大家考虑的还是资本，把能赚钱的公司留下来，好的资源都是开放给有钱人有权人的。所以如果没有一定的经济实力和稳定的收入来源，我是不建议普通人去深圳卷的，因为大部分人最后只会累坏身体付出了青春，然后在这座城市煎熬的活着，这不是人生的意义。有努力有付出同时也能让你在一座城市过上幸福的生活，这才是我们该有的人生。当然你要是真的很牛的人才，有自信在深圳卷出一番天地的，是可以去努力奋斗的。未来深圳会是更卷的城市了，每个人都是人才，天之骄子。",
